import React from "react";
import "./Banner.css";

const Banner = () => (
  <div className="banner text-center d-flex align-items-center">
    <p className="m-0">
      Test your memory! Click on an image to gain a point. Each time you click on a NEW Image you keep scoring. Click on the same image twice and you lose. 
    </p>
  </div>
);

export default Banner;
